// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import Dashboard from './pages/Dashboard';
import Reports from './pages/Reports';
import Courses from './pages/Courses';
import Monitoring from './pages/Monitoring';
import Ratings from './pages/Ratings';
import HomePage from './pages/HomePage';

import StudentDashboard from './components/student/StudentDashboard';
import StudentMonitoring from './components/student/Monitoring';
import ReportForm from './components/lecturer/ReportForm';
import CourseManagement from './components/program-leader/CourseManagement';
import ClassManagement from './components/program-leader/ClassManagement';
import UserManagement from './components/program-leader/UserManagement';
import ProtectedRoute from './utils/ProtectedRoute';
import RoleBasedRoute from './utils/RoleBasedRoute';
import './styles/App.css';

import Profile from './components/common/Profile';
import Settings from './components/common/Settings';
import NotFound from './components/common/NotFound';
import Footer from './components/common/Footer';
import Header from './components/common/Header';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App d-flex flex-column min-vh-100">

          {/* Header */}
          <Header />

          {/* Fixed Navbar */}
          <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top overlay-navbar">
            <div className="container">
              <Link className="navbar-brand" to="/">LUCT Reporting</Link>
              <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                  <li className="nav-item">
                    <Link className="nav-link" to="/dashboard">Dashboard</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/reports">Reports</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/courses">Courses</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/monitoring">Monitoring</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/ratings">Ratings</Link>
                  </li>
                </ul>

                <ul className="navbar-nav ms-auto">
                  <li className="nav-item">
                    <Link className="nav-link" to="/profile">Hello, Tsepang Thabana</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/settings">Settings</Link>
                  </li>
                </ul>
              </div>
            </div>
          </nav>

          {/* Main content */}
          <div className="flex-grow-1 p-3 overlay-content">
            <Routes>
              {/* Public & Protected Routes (same as before) */}
              <Route path="/" element={<HomePage />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
              <Route path="/student/dashboard" element={<RoleBasedRoute allowedRoles={['student']}><StudentDashboard /></RoleBasedRoute>} />
              <Route path="/reports" element={<ProtectedRoute><Reports /></ProtectedRoute>} />
              <Route path="/reports/new" element={<RoleBasedRoute allowedRoles={['lecturer']}><ReportForm /></RoleBasedRoute>} />
              <Route path="/reports/edit/:id" element={<RoleBasedRoute allowedRoles={['lecturer']}><ReportForm /></RoleBasedRoute>} />
              <Route path="/courses" element={<ProtectedRoute><Courses /></ProtectedRoute>} />
              <Route path="/courses/management" element={<RoleBasedRoute allowedRoles={['program_leader']}><CourseManagement /></RoleBasedRoute>} />
              <Route path="/classes/management" element={<RoleBasedRoute allowedRoles={['program_leader']}><ClassManagement /></RoleBasedRoute>} />
              <Route path="/monitoring" element={<ProtectedRoute><Monitoring /></ProtectedRoute>} />
              <Route path="/student/monitoring" element={<RoleBasedRoute allowedRoles={['student']}><StudentMonitoring /></RoleBasedRoute>} />
              <Route path="/ratings" element={<ProtectedRoute><Ratings /></ProtectedRoute>} />
              <Route path="/ratings/class/:classId" element={<ProtectedRoute><Ratings /></ProtectedRoute>} />
              <Route path="/users/management" element={<RoleBasedRoute allowedRoles={['program_leader', 'principal_lecturer']}><UserManagement /></RoleBasedRoute>} />
              <Route path="/profile" element={<ProtectedRoute><Profile /></ProtectedRoute>} />
              <Route path="/settings" element={<ProtectedRoute><Settings /></ProtectedRoute>} />
              <Route path="*" element={<NotFound />} />
            </Routes>
          </div>

          {/* Footer */}
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
